import { Component } from "react";
import { Container, Row, Col } from "react-bootstrap";

class Footer extends Component {
    render() {
        return (
            <Row>
                <Col>Footer Left</Col>
                <Col>
                    <Container fluid>
                        <Row>
                            <Col>Col-1</Col>
                            <Col>Col-2</Col>
                            <Col>Col-3</Col>
                            <Col>Col-4</Col>
                        </Row>
                    </Container>
                </Col>
            </Row>
        );
    }
}

export default Footer;
